import React from "react";
import FormattedTime from "./FormattedTime";

export default function SunriseSunset() {
return (
    <div className="sunrise-sunset-data">
    <div class="row">
      <div class="col-2"></div>
      <div class="col-2"></div>
      <div class="col-2" id="sunrise">
        <img id="sunrise-icon" src="images/SUNRISE.png" alt="sunrise-icon" />
        <span id="sunrise-time">
          <FormattedTime date={PaymentResponse.da.sunrise} />
        </span>
      </div>
      <div class="col-2" id="sunset">
        <img id="sunset-icon" src="images/SUNSET.png"  alt="sunset-icon"/>
        <span id="sunset-time">
          {/* <FormattedTime date={props.data.sunset} /> */}
        </span>
      </div>
      </div>
    </div>
  );
}
